#
# TABLE STRUCTURE FOR: guests
#

DROP TABLE IF EXISTS `guests`;

CREATE TABLE `guests` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `first_name` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя пользователя',
  `last_name` varchar(128) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Фамилия пользователя',
  `email` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(30) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон',
  `adress` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес',
  `details` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Дополнительная информация',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Гости';



#
# TABLE STRUCTURE FOR: hotels
#

DROP TABLE IF EXISTS `hotels`;

CREATE TABLE `hotels` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `hotel_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название отеля',
  `hotel_description` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Описание отеля',
  `category_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на категорию отеля',
  `adress_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на адрес отеля',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон',
  `is_active` tinyint(1) NOT NULL COMMENT 'Состояние отеля: работает или нет',
  PRIMARY KEY (`id`),
  UNIQUE KEY `hotel_name` (`hotel_name`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`),
  KEY `hotels_category_id_fk` (`category_id`),
  KEY `hotels_adress_id_fk` (`adress_id`),
  CONSTRAINT `hotels_adress_id_fk` FOREIGN KEY (`adress_id`) REFERENCES `hotels_adresses` (`id`),
  CONSTRAINT `hotels_category_id_fk` FOREIGN KEY (`category_id`) REFERENCES `hotels_categories` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Отели';



#
# TABLE STRUCTURE FOR: hotels_adresses
#

DROP TABLE IF EXISTS `hotels_adresses`;

CREATE TABLE `hotels_adresses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `country_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название страны',
  `city_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название города',
  `postal_id` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название города',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Адреса отелей';



#
# TABLE STRUCTURE FOR: hotels_categories
#

DROP TABLE IF EXISTS `hotels_categories`;

CREATE TABLE `hotels_categories` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `categoty_name` enum('*','**','***','****','*****') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя категории отеля',
  PRIMARY KEY (`id`),
  UNIQUE KEY `categoty_name` (`categoty_name`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Категории отелей';



#
# TABLE STRUCTURE FOR: invoice_guest
#

DROP TABLE IF EXISTS `invoice_guest`;

CREATE TABLE `invoice_guest` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `guest_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на гостя',
  `reservation_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на бронирование',
  `invoice_amount` decimal(10,2) DEFAULT NULL COMMENT 'Сумма к оплате',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания счета',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время оплаты счета',
  `canceled_at` datetime DEFAULT NULL COMMENT 'Время отмены счета',
  PRIMARY KEY (`id`),
  KEY `invoice_guest_guest_id_fk` (`guest_id`),
  KEY `invoice_guest_reservation_id_fk` (`reservation_id`),
  CONSTRAINT `invoice_guest_guest_id_fk` FOREIGN KEY (`guest_id`) REFERENCES `guests` (`id`),
  CONSTRAINT `invoice_guest_reservation_id_fk` FOREIGN KEY (`reservation_id`) REFERENCES `reservations` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Счет';



#
# TABLE STRUCTURE FOR: reservation_status_catalog
#

DROP TABLE IF EXISTS `reservation_status_catalog`;

CREATE TABLE `reservation_status_catalog` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `status_name` enum('confirmed','turn away','cancelled','tentative','waitlist') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Статус бронирования',
  PRIMARY KEY (`id`),
  UNIQUE KEY `status_name` (`status_name`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Список уникальных статусов бронирования';



#
# TABLE STRUCTURE FOR: reservation_status_events
#

DROP TABLE IF EXISTS `reservation_status_events`;

CREATE TABLE `reservation_status_events` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `reservation_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на бронирование',
  `reservation_status_catalog_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на статус бронирования',
  `details` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Дополнительная информация',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время присваивания статуса',
  PRIMARY KEY (`id`),
  KEY `reservation_status_events_reservation_id_fk` (`reservation_id`),
  KEY `reservation_status_events_reservation_status_catalog_id_fk` (`reservation_status_catalog_id`),
  CONSTRAINT `reservation_status_events_reservation_id_fk` FOREIGN KEY (`reservation_id`) REFERENCES `reservations` (`id`),
  CONSTRAINT `reservation_status_events_reservation_status_catalog_id_fk` FOREIGN KEY (`reservation_status_catalog_id`) REFERENCES `reservation_status_catalog` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Информация о событиях бронирования';



#
# TABLE STRUCTURE FOR: reservations
#

DROP TABLE IF EXISTS `reservations`;

CREATE TABLE `reservations` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `guest_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на гостя',
  `start_date` date NOT NULL COMMENT 'Дата начала бронирования',
  `end_date` date NOT NULL COMMENT 'Дата окончания бронирования',
  `discount_percent` decimal(5,2) DEFAULT 0.00 COMMENT '% скидки',
  `total_price` decimal(10,2) DEFAULT NULL COMMENT 'Стоимость бронирования',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания бронирования',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления бронирования',
  PRIMARY KEY (`id`),
  KEY `reservations_guest_id_fk` (`guest_id`),
  CONSTRAINT `reservations_guest_id_fk` FOREIGN KEY (`guest_id`) REFERENCES `guests` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Бронирования';



#
# TABLE STRUCTURE FOR: room_reserved
#

DROP TABLE IF EXISTS `room_reserved`;

CREATE TABLE `room_reserved` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `reservation_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на бронирование',
  `room_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на номер',
  `price` decimal(10,2) DEFAULT NULL COMMENT 'Стоимость номера',
  PRIMARY KEY (`id`),
  KEY `room_reserved_reservation_id_fk` (`reservation_id`),
  KEY `room_reserved_room_id_fk` (`room_id`),
  CONSTRAINT `room_reserved_reservation_id_fk` FOREIGN KEY (`reservation_id`) REFERENCES `reservations` (`id`),
  CONSTRAINT `room_reserved_room_id_fk` FOREIGN KEY (`room_id`) REFERENCES `rooms` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Cписок забронированных номеров';



#
# TABLE STRUCTURE FOR: room_types
#

DROP TABLE IF EXISTS `room_types`;

CREATE TABLE `room_types` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `type_name` enum('single','double','apartment','queen','king') COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя категории номера',
  PRIMARY KEY (`id`),
  UNIQUE KEY `type_name` (`type_name`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Категории отельных номеров';



#
# TABLE STRUCTURE FOR: rooms
#

DROP TABLE IF EXISTS `rooms`;

CREATE TABLE `rooms` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `room_type_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на категорию номера',
  `room_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название номера',
  `hotel_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на отель',
  `current_price` decimal(10,2) DEFAULT NULL COMMENT 'Текущая стоимость номера',
  `room_description` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Описание номера',
  PRIMARY KEY (`id`),
  KEY `rooms_room_type_id_fk` (`room_type_id`),
  KEY `rooms_hotel_id_fk` (`hotel_id`),
  CONSTRAINT `rooms_hotel_id_fk` FOREIGN KEY (`hotel_id`) REFERENCES `hotels` (`id`),
  CONSTRAINT `rooms_room_type_id_fk` FOREIGN KEY (`room_type_id`) REFERENCES `room_types` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Номера';



